import React, {useEffect, useState} from 'react';
import {ADD_ROPES_IN_STOCK_PAGE, AUTH_PAGE, ROPES_IN_STOCK_PAGE} from "./const";
import AddProductsPage from "../Pages/AddProductsPage/AddProductsPage";
import RopesInStockPage from "../Pages/RopesInStockPage/RopesInStockPage";
import {Route, Routes} from "react-router-dom";
import Header from "../Components/Header/Header";
import AuthPage from "../Pages/AuthPage/AuthPage";
import {useDispatch} from "react-redux";
import {getIsAuth} from "../store/User/selectors";
import {privateRoute} from "./routes";

const AppRoutes = () => {
    // const dispatch = useDispatch()
    // const [isAuth, setIsAuth] = useState(false);
    //
    // useEffect( () => {
    //     const getAuth = dispatch(getIsAuth);
    //     setIsAuth(getAuth);
    // }, [])

    return (
        <>
            <Header/>
            <Routes>
                {/*{isAuth ? privateRoute.map(route => {return <Route element={route.component} exact path={route.path}/>}) : <Route element={<AuthPage/>} exact path={AUTH_PAGE}/>}*/}
                <Route element={<AddProductsPage/>} exact path={ADD_ROPES_IN_STOCK_PAGE}/>
                <Route element={<RopesInStockPage/>} exact path={ROPES_IN_STOCK_PAGE}/>

            </Routes>
        </>
    );
};

export default AppRoutes;
